import React from "react";
import {
    Draggable,
    DropZone
  } from "react-native-drag-drop-and-swap";

  import DraggyInner from './DraggyInner';
/* Canvas props */
interface draggyProps {
    onDrop?: any,
    onHover?: any,
    dragOver?: any,
    alphabet?:any,
    index?: any
  }
  
 export default class Draggy extends React.Component<draggyProps> {
    render() {
      return (
        <Draggable data={this.props.alphabet} style={{ margin: 7.5 }}>
          <DropZone
            onDrop={(e: any) => this.props.onDrop(e, this.props.index)}
            onEnter={() =>
              this.props.onHover(this.props.alphabet, this.props.index)
            }
          >
            <DraggyInner
              alphabet={this.props.alphabet}
              index={this.props.index}
            />
          </DropZone>
        </Draggable>
      );
    }
  }
